import React, { useState, useEffect } from 'react';
import { Container, Typography, Paper, Grid, Button, FormControl, InputLabel, MenuItem, Select, Box, SelectChangeEvent, TextField } from '@mui/material';
import { DateTimePicker } from '@mui/x-date-pickers/DateTimePicker';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';
import api from '../services/api';

interface Space {
  id: string;
  name: string;
}

interface Seatplace {
  id: string;
  spaceId: string;
  spaceName: string;
}

const BookingPage: React.FC = () => {
  const [spaces, setSpaces] = useState<Space[]>([]);
  const [seatplaces, setSeatplaces] = useState<Seatplace[]>([]);
  const [selectedSpace, setSelectedSpace] = useState<string>('');
  const [selectedSeatplace, setSelectedSeatplace] = useState<string>('');
  const [startTime, setStartTime] = useState<Date | null>(new Date());
  const [endTime, setEndTime] = useState<Date | null>(new Date(Date.now() + 3600000)); // +1 hour
  const [message, setMessage] = useState<string>('');
  const [error, setError] = useState<string>('');

  useEffect(() => {
    // Fetch spaces
    api.get('/api/spaces')
      .then(response => {
        setSpaces(response.data);
      })
      .catch(error => {
        console.error('Error fetching spaces:', error);
        setError('Failed to load spaces');
      });
  }, []);

  useEffect(() => {
    // Fetch seatplaces when space is selected
    if (selectedSpace) {
      api.get(`/api/spaces/${selectedSpace}/seatplaces`)
        .then(response => {
          setSeatplaces(response.data);
        })
        .catch(error => {
          console.error('Error fetching seatplaces:', error);
          setError('Failed to load seatplaces');
        });
    } else {
      setSeatplaces([]);
    }
  }, [selectedSpace]);

  const handleSpaceChange = (event: SelectChangeEvent) => {
    setSelectedSpace(event.target.value);
    setSelectedSeatplace('');
  };

  const handleSeatplaceChange = (event: SelectChangeEvent) => {
    setSelectedSeatplace(event.target.value);
  };

  const handleBooking = async () => {
    if (!selectedSeatplace || !startTime || !endTime) {
      setError('Please fill in all required fields');
      return;
    }

    try {
      const response = await api.post('/api/bookings', {
        seatplaceId: selectedSeatplace,
        startTime: startTime.toISOString(),
        endTime: endTime.toISOString()
      });

      setMessage('Booking successful!');
      setError('');
      // Reset form
      setSelectedSeatplace('');
    } catch (error) {
      console.error('Error creating booking:', error);
      setError('Failed to create booking. The seat might be already booked for this time.');
    }
  };

  return (
    <LocalizationProvider dateAdapter={AdapterDateFns}>
      <Container maxWidth="md" sx={{ mt: 4 }}>
        <Typography variant="h4" gutterBottom>
          Book a Workspace
        </Typography>

        <Paper elevation={3} sx={{ p: 3, mb: 4 }}>
          <Grid container spacing={3}>
            {/* Space selection */}
            <Grid item xs={12}>
              <FormControl fullWidth>
                <InputLabel id="space-select-label">Coworking Space</InputLabel>
                <Select
                  labelId="space-select-label"
                  id="space-select"
                  value={selectedSpace}
                  label="Coworking Space"
                  onChange={handleSpaceChange}
                >
                  {spaces.map(space => (
                    <MenuItem key={space.id} value={space.id}>
                      {space.name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
            </Grid>

            {/* Seatplace selection */}
            <Grid item xs={12}>
              <FormControl fullWidth disabled={!selectedSpace}>
                <InputLabel id="seatplace-select-label">Seat</InputLabel>
                <Select
                  labelId="seatplace-select-label"
                  id="seatplace-select"
                  value={selectedSeatplace}
                  label="Seat"
                  onChange={handleSeatplaceChange}
                >
                  {seatplaces.map(seat => (
                    <MenuItem key={seat.id} value={seat.id}>
                      Seat in {seat.spaceName}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
            </Grid>

            {/* Date/time selection */}
            <Grid item xs={12} md={6}>
              <DateTimePicker
                label="Start Time"
                value={startTime}
                onChange={(newValue: Date | null) => setStartTime(newValue)}
                slotProps={{ textField: { fullWidth: true } }}
              />
            </Grid>

            <Grid item xs={12} md={6}>
              <DateTimePicker
                label="End Time"
                value={endTime}
                onChange={(newValue: Date | null) => setEndTime(newValue)}
                slotProps={{ textField: { fullWidth: true } }}
              />
            </Grid>

            {/* Submit button */}
            <Grid item xs={12}>
              <Button 
                variant="contained" 
                color="primary" 
                fullWidth 
                onClick={handleBooking}
                disabled={!selectedSeatplace || !startTime || !endTime}
              >
                Book Now
              </Button>
            </Grid>
          </Grid>
        </Paper>

        {/* Messages */}
        {message && (
          <Box sx={{ mb: 2, p: 2, bgcolor: 'success.light', color: 'success.contrastText', borderRadius: 1 }}>
            {message}
          </Box>
        )}

        {error && (
          <Box sx={{ mb: 2, p: 2, bgcolor: 'error.light', color: 'error.contrastText', borderRadius: 1 }}>
            {error}
          </Box>
        )}
      </Container>
    </LocalizationProvider>
  );
};

export default BookingPage;
